    <div {...{
      "className": "admonition admonition-important alert alert--info"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M7 2.3c3.14 0 5.7 2.56 5.7 5.7s-2.56 5.7-5.7 5.7A5.71 5.71 0 0 1 1.3 8c0-3.14 2.56-5.7 5.7-5.7zM7 1C3.14 1 0 4.14 0 8s3.14 7 7 7 7-3.14 7-7-3.14-7-7-7zm1 3H6v5h2V4zm0 6H6v2h2v-2z"
              }}></path></svg></span>{`重要提示`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`RKE add-on 安装仅支持 Rancher v2.0.8 之前的版本。
请使用 Rancher helm chart 将 Rancher 安装在 Kubernetes 集群上。有关详细信息，请参见`}<a parentName="p" {...{
            "href": "/docs/rancher2/installation/k8s-install/_index"
          }}>{`Rancher 高可用安装`}</a>{`。
如果您当前正在使用 RKE add-on 安装方法，参见`}<a parentName="p" {...{
            "href": "/docs/rancher2/upgrades/upgrades/migrating-from-rke-add-on/_index"
          }}>{`将 RKE add-on 安装的 Rancher 迁移到 Helm 安装`}</a>{`，获取有关如何使用 Helm chart 的详细信息。`}</p></div></div>
    <p>{`如果您在代理后面操作 Rancher，并且想要通过代理访问服务（例如拉取应用商店），则必须提供有关 Rancher 代理的信息。 Rancher 是用 Go 语言编写的，因此它使用了常见的代理环境变量，如下表所示：`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`变量名称`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`HTTP_PROXY`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`HTTP 连接的代理地址`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`HTTPS_PROXY`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`HTTPS 连接的代理地址`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`NO_PROXY`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`不使用代理的网络地址，网络地址范围和域。变量名称必须为大写才能使用无类别域间路由表示法（CIDR）。请确保`}<inlineCode parentName="td">{`NO_PROXY`}</inlineCode>{`包含不应使用代理的网络地址，网络地址范围和域。`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "rancher-高可用安装"
    }}>{`Rancher 高可用安装`}</h2>
    <p>{`使用 Kubernetes 安装时，需要将环境变量添加到 RKE 配置文件的模板中。`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/docs/rancher2/installation/options/rke-add-on/layer-4-lb/_index"
        }}>{`使用外部负载均衡器（TCP / Layer 4）RKE 配置文件模板进行 Rancher 高可用`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/docs/rancher2/installation/options/rke-add-on/layer-7-lb/_index"
        }}>{`使用外部负载均衡器（HTTPS / Layer 7）RKE 配置文件模板进行 Rancher 高可用`}</a></li>
    </ul>
    <p>{`环境变量应在 RKE 配置文件模板内部的 `}<inlineCode parentName="p">{`Deployment`}</inlineCode>{` 定义。您只需将它添加到从 `}<inlineCode parentName="p">{`env:`}</inlineCode>{` 开头(但不包括)到 `}<inlineCode parentName="p">{`ports:`}</inlineCode>{`结束的部分。确保缩进与前面的 `}<inlineCode parentName="p">{`name:`}</inlineCode>{` 相同。需要配置 `}<inlineCode parentName="p">{`NO_PROXY`}</inlineCode>{` 的值为:`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`localhost`}</inlineCode></li>
      <li parentName="ul"><inlineCode parentName="li">{`127.0.0.1`}</inlineCode></li>
      <li parentName="ul"><inlineCode parentName="li">{`0.0.0.0`}</inlineCode></li>
      <li parentName="ul">{`配置 `}<inlineCode parentName="li">{`service_cluster_ip_range`}</inlineCode>{` (默认值: `}<inlineCode parentName="li">{`10.43.0.0/16`}</inlineCode>{`)`}</li>
    </ul>
    <p>{`下面的示例基于一个 Rancher 可访问的代理服务器 `}<inlineCode parentName="p">{`http://192.168.0.1:3128`}</inlineCode>{`，Rancher 会使用这个代理服务器发送请求，但不包括访问网络范围 `}<inlineCode parentName="p">{`192.168.10.0/24`}</inlineCode>{`，`}<inlineCode parentName="p">{`service_cluster_ip_range`}</inlineCode>{` (`}<inlineCode parentName="p">{`10.43.0.0/16`}</inlineCode>{`) 以及域 `}<inlineCode parentName="p">{`example.com`}</inlineCode>{` 下的所有主机名。如果更改了 `}<inlineCode parentName="p">{`service_cluster_ip_range`}</inlineCode>{`，则必须相应地更新下面的值。`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-yaml"
      }}>{`---
kind: Deployment
apiVersion: extensions/v1beta1
metadata:
  namespace: cattle-system
  name: cattle
spec:
  replicas: 1
  template:
    metadata:
      labels:
        app: cattle
    spec:
      serviceAccountName: cattle-admin
      containers:
        - image: rancher/rancher:latest
          imagePullPolicy: Always
          name: cattle-server
          env:
            - name: HTTP_PROXY
              value: "http://192.168.10.1:3128"
            - name: HTTPS_PROXY
              value: "http://192.168.10.1:3128"
            - name: NO_PROXY
              value: "localhost,127.0.0.1,0.0.0.0,10.43.0.0/16,192.168.10.0/24,example.com"
          ports:
`}</code></pre>
    </MDXLayout>;
}

;
